import React from "react";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from './home'
import Navbar from './navbar'
import Yoann from './Yoann'
import CV from './CV'
import Projet from './projet'


function App() {

  return (
    <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/Yoann' exact element={<Yoann/>} />
        </Routes>
   </BrowserRouter>
  );
};

export default App;
